import React from 'react';

import './App.css';
import {tweets} from '../../constants';
import Tweet from '../../components/Tweet';


console.log(tweets);
const App = () => (

    tweets.map((tweet, index) =>
            <Tweet
                key = {index}
                avatar =  {tweets.avatar}
                fullname = {tweets.fullname}
                date = {tweets.date}
                content = {tweets.content} 

            
            />

        )


    
);

export default App;
